import React, { Component } from 'react';

import Child from './child.jsx';


class Explain extends Component{
    render(){
        return(
            <div className="parent">
                <p>Parent</p>
                <div className="child-list">
                    <Child wait_one={7000} />
                    <Child wait_two={8000} />
                    <Child wait_three={9000} />
                </div>
            </div>
        );
    }
}


export default Explain;
